import axios from "axios";
import apiClient from "./http-common"

let infoList = [];
const res = axios.get('http://localhost:8080/users/' + localStorage.getItem("user_id"), {
  headers: {
    'Authorization': localStorage.getItem("TokenHeader")
  }
});
res.data instanceof Object;
infoList = Object.entries(res.data)
export default infoList;
